import React from "react";
import './Patient.css';

function PatientComponent() {

  const timelineData = [
    {
      date: "January 2022",
      title: "Doctor Visit",
      description: "Regular checkup with the family doctor",
    },
    {
      date: "March 2022",
      title: "MRI Scan",
      description: "Scan to check for any internal injuries or damage",
    },
    {
      date: "May 2022",
      title: "Blood Test",
      description: "Routine blood test to check for any abnormalities",
    },
    // Add more events here as needed
  ];

  return (
    <div className="Patient-body-container">

      {/* Timeline of the patient medical history */}
      <div className="timeline-container">
         <div class="timeline-header"> Timeline of Health Activites </div>
         <div class="timeline">
            {timelineData.map((event, index) => (
              <div key={index}>
                <h3>{event.date}</h3>
                <h4>{event.title}</h4>
                <p>{event.description}</p>
              </div>
            ))}
         </div>
      </div>

      {/* Profile of the patient */}
      <div className="profile-container">
            <h1> Profile of the Patient </h1>
      </div>

    </div>
  );
}

export default PatientComponent;
